import axios, { AxiosResponse } from 'axios'

const baseUrl: string = "http://localhost:4000"

export const addDamagedDefect = async(
  formData: IDamagedDefect
): Promise<AxiosResponse<ApiDataType>> => {
  try {
    const damagedDefect: Omit<IDamagedDefect, "_id"> = {
      received: formData.received,
      order_number: formData.order_number,
      vendor: formData.vendor,
      sku_number: formData.sku_number,
      damage_level: formData.damage_level,
      discount_refund_replace: formData.discount_refund_replace,
      narvar_return_info: formData.narvar_return_info,
      item_amount: formData.item_amount,
      file_case_description: formData.file_case_description,
      action_needed: formData.action_needed
    }
    const saveDamagedDefect: AxiosResponse<ApiDataType> = await axios.post(
      baseUrl + "/submit-damaged-defect",
      damagedDefect
    )
    return saveDamagedDefect
  } catch (error) {
    throw new Error(error)
  }
}
